import React from 'react'
import {Card, Button} from 'react-bootstrap'


class ProductCard extends React.Component{
    render(){
        return(
            <div>
                <Card border="info" style={{ width: '15rem'}}>
                    <Card.Img variant="top" src={"./media/products/" + this.props.product.filename + "-1.png"} />
                    <Card.Body>
                    <Card.Header>{this.props.product.name}</Card.Header>
                    <Card.Text>
                        ${this.props.product.price}
                    </Card.Text>
                    {/* <Card.Link className="position-absolute" style={{float: "right"}}>Details</Card.Link> */}
                    </Card.Body>
                    <Button variant="info" className="position-absolute" style={{float: "right"}}>Details</Button>
                </Card>
            </div>
        )
    }
}

export default ProductCard;
